def check(s):
    for i in range(len(s)):
        if s[i] == "1":
            s = s[:i] + s[i + 1 :]
            if int(s, 2) % 64 == 0:
                return True
    return False


s = input()
print("yes" if check(s) else "no")

def is_divisible_by_64(s):
    if len(s) % 4 != 0:
        return False
    for i in range(0, len(s), 4):
        if int(s[i:i + 4], 2) % 64 != 0:
            return False
    return True

if __name__ == '__main__':
    s = input()
    if is_divisible_by_64(s):
        print('yes')
    else:
        print('no')
