def is_divisible_by_64(s):
    if len(s) % 4 != 0:
        return False
    for i in range(0, len(s), 4):
        if int(s[i:i + 4], 2) % 64 != 0:
            return False
    return True


if __name__ == '__main__':
    s = input()
    if is_divisible_by_64(s):
        print('yes')
    else:
        print('no')
